import React from "react";
import "./card.scss";
import { Link } from "react-router-dom";

const Card = ({item}) => {
    return (
      <Link className="link" to={`/product/${item.id}`}>
        <div className="card">
          <img src="{item.img}" alt="" className="mainImg" />
        </div>
      </Link>
    );
};

export default Card;
